import React, { Component } from 'react'
import { connect } from 'react-redux';
import Header from '../../components/Header/Header';
import Card from '../../components/Card/Card';
import { ButtonSearch } from '../../components/Buttons/Button';

import * as actionCreators from '../../store/actions/index';

class Pokedex extends Component {
  constructor(props) {
    super(props);
    console.log(props);
    this.state = {
      search: '',
    }
  }

  render() {
    const { search } = this.state;
    const { pokemon } = this.props;
    console.log(pokemon)
    return (
      <div>
        <Header titleBrand="Awesome Pokedex" labelButton="Buscar" value={search}/>
        <ButtonSearch onClick={() => this.props.searchPokemon()} backgroundcolor="green" color="white">Teste</ButtonSearch>
        <Card pokemons={this.props.pokemon}/>
      </div>
    )
  }
}

const mapStateToProps = state => {
  return state;
};

export default connect(mapStateToProps, actionCreators)(Pokedex);
